export const progressCartConfig ={
    backgroundColor: '#bdedfe',
    backgroundGradientFrom: '#10ADEF',
    backgroundGradientTo: '#10ADEF',
    decimalPlaces: 2,
    color: (opacity = 9) => `rgba(189, 237, 254, ${opacity})`,
    labelColor: (opacity = 9) => `rgba(255, 255,255, ${opacity})`,
    style: {
        borderRadius: 16,
    },
};
